          },
          {
            id:'cat2',
            name:'school'
          }
        ]
      }
    render(){
        return (
        <p className="panel-tabs">
            <a className="is-active">All</a>
            <a>+ Add Category</a>
        </p>
        )
    }
}

export default Tabs
